uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User Parameters
uniform float u_speed;
uniform float u_camera_dist;
uniform float u_fov;
uniform float u_glow_intensity;

out vec4 fragColor;

// --- UTILS ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Smooth Minimum for organic blending
float smin(float d1, float d2, float k) {
    float h = clamp(0.5 + 0.5 * (d2 - d1) / k, 0.0, 1.0);
    return mix(d2, d1, h) - k * h * (1.0 - h);
}

// Path of the camera/universe
vec2 getPath(float z) {
    return vec2(
        sin(z * 0.15) * 3.5,
        cos(z * 0.1) * 2.0
    );
}

// --- SDF WORLD ---
float map(vec3 p) {
    // Universe Path offset
    p.xy -= getPath(p.z);

    // Twist the space
    float twist = p.z * 0.1;
    p.xy *= rot(twist);

    // Infinite folding mirrors logic
    vec3 q = p;
    float scale = 4.0;
    q = mod(q + scale, scale * 2.0) - scale; // Infinite repetition

    // Central "ribbon" or core structure
    float core = length(p.xy) - 0.2;

    // Floating smooth primitives
    float spheres = length(q) - 0.8;
    float rings = length(vec2(length(q.xy) - 1.5, q.z)) - 0.1;

    // Blend it all together for that "smooth fade" look
    float d = smin(core, spheres, 2.5);
    d = smin(d, rings, 1.5);

    return d * 0.6; // Step down to prevent artifacts in warped space
}

// Simple normal calculation
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

// Palette function for cinematic gradients
vec3 palette(float t) {
    vec3 a = vec3(0.5, 0.5, 0.5);
    vec3 b = vec3(0.5, 0.5, 0.5);
    vec3 c = vec3(1.0, 1.0, 1.0);
    vec3 d = vec3(0.263, 0.416, 0.557);
    return a + b * cos(6.28318 * (c * t + d));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float time = iTime * u_speed;

    // 1. Path Calculation
    vec3 pathPos = vec3(0.0, 0.0, time);
    pathPos.xy += getPath(pathPos.z);

    // 2. Parallel Rail Camera
    // Camera orbits the center of the path but moves forward with it
    float angle = time * 0.2;
    vec2 railOffset = vec2(cos(angle), sin(angle)) * u_camera_dist;

    vec3 ro = pathPos;
    ro.xy += railOffset;

    // Target looks ahead and slightly inward
    vec3 ta = vec3(0.0, 0.0, time + 8.0);
    ta.xy += getPath(ta.z) + railOffset * 0.5;

    // Camera Basis
    vec3 fwd = normalize(ta - ro);
    vec3 right = normalize(cross(vec3(0, 1, 0), fwd));
    vec3 up = cross(fwd, right);
    vec3 rd = normalize(fwd * u_fov + uv.x * right + uv.y * up);

    // 3. Raymarching
    float d, t = 0.0;
    float glow = 0.0;

    for(int i = 0; i < 90; i++) {
        vec3 p = ro + rd * t;
        d = map(p);

        // Accumulate glow based on proximity to objects
        glow += exp(-d * 3.0) * u_glow_intensity;

        if(d < 0.001 || t > 50.0) break;
        t += d;
    }

    // 4. Coloring and Shading
    vec3 col = vec3(0.0);

    if(t < 50.0) {
        vec3 p = ro + rd * t;
        vec3 n = getNormal(p);
        vec3 lightDir = normalize(vec3(1, 2, -1));

        // Basic lighting
        float diff = max(dot(n, lightDir), 0.0);
        float fresnel = pow(1.0 - max(dot(n, -rd), 0.0), 5.0);

        // Gradient based on distance and depth
        vec3 baseCol = palette(p.z * 0.05 + time * 0.1);
        col = baseCol * diff;
        col += fresnel * baseCol * 2.0; // Rim lighting
    }

    // Volumetric / Background Gradient
    vec3 bgCol = palette(rd.z * 2.0 + time * 0.05) * 0.2;
    col = mix(col, bgCol, smoothstep(0.0, 50.0, t));

    // Add the glow "Aura"
    col += palette(t * 0.1 + time * 0.2) * glow * 0.02;

    // 5. Post Processing
    // Contrast and Bloom-ish feel
    col = smoothstep(-0.1, 1.1, col);
    col = pow(col, vec3(0.4545)); // Gamma correction

    // Vignette
    float vig = 1.0 - dot(uv, uv) * 0.4;
    col *= vig;

    fragColor = vec4(col, 1.0);
}
